"Mendoza vs Aquino\",\"complaint_desc\":\"Michael Santos Mendoza was born on December 18, 1988. He alleged that at around 12 midnight on October 31, 2018, he was on his way home to Barangay 385, Quiapo, Manila, when he encountered a petitioner accompanied by Rodjun Aquino. Mendoza, seemingly annoyed by Aquino, brought Mendoza near the church and hit Mendoza right shoulder with a stone and punched him on the right cheek.\\r\\n\\r\\nDr. Tanyag conducted a medical examination on Mendoza. The examination showed that Mendoza suffered from confluent abrasion on the left shoulder and soft tissue contusion in the deltoid area and bore a soft tissue contusion on the left periorbital area and on the right occipital parietal area of the head.\",\"relief_desc\":\"The RTC must found petitioner guilty beyond reasonable doubt of Other Acts of Child Abuse, as defined and penalized under Sec. 10, par. of R.A. No. 7610. Accordingly, it sentenced petitioner to suffer the indeterminate penalty of four years, nine months and eleven days of prision correccional, as minimum, to six years and eight months and one day of prision.\",\"date_of_incident\":\"2018-10-31 00:00:00\",\"date_reported\":\"2022-11-21 00:35:22\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:35:22.000000Z\",\"updated_at\":\"2022-11-20T16:35:22.000000Z\"}}',NULL,'2022-11-20 16:35:22','2022-11-20 16:35:22'),(26,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',5,'App\\Models\\User',1,'{\"attributes\":{\"id\":5,\"article_no\":266,\"case_no\":5,\"created_at\":\"2022-11-20T16:35:22.000000Z\",\"updated_at\":\"2022-11-20T16:35:22.000000Z\"}}',NULL,'2022-11-20 16:35:22','2022-11-20 16:35:22'),(27,'Account','Person created','App\\Models\\Person','created',9,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":9,\"salutation\":\"Mr.\",\"first_name\":\"Michael\",\"middle_name\":\"Santos\",\"last_name\":\"Mendoza\",\"created_at\":\"2022-11