r documentation prior to the procedural return of the warrant of arrest to the Manila City Regional Trial Court Branch 117 where he is facing estafa charges in relation to RA 10175 or the Cybercrime Prevention Act of 2012.\",\"date_of_incident\":\"2016-09-25 00:00:00\",\"date_reported\":\"2022-11-21 00:36:25\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:36:25.000000Z\",\"updated_at\":\"2022-11-20T16:36:25.000000Z\"}}',NULL,'2022-11-20 16:36:25','2022-11-20 16:36:25'),(32,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',6,'App\\Models\\User',1,'{\"attributes\":{\"id\":6,\"article_no\":315,\"case_no\":6,\"created_at\":\"2022-11-20T16:36:25.000000Z\",\"updated_at\":\"2022-11-20T16:36:25.000000Z\"}}',NULL,'2022-11-20 16:36:25','2022-11-20 16:36:25'),(33,'Account','Person created','App\\Models\\Person','created',11,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":11,\"salutation\":\"Ms.\",\"first_name\":\"Chloe\",\"middle_name\":\"Torres\",\"last_name\":\"Oliva\",\"created_at\":\"2022-11-20T16:36:25.000000Z\",\"updated_at\":\"2022-11-20T16:36:25.000000Z\"}}',NULL,'2022-11-20 16:36:25','2022-11-20 16:36:25'),(34,'Account','Person created','App\\Models\\Person','created',12,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":12,\"salutation\":\"Mr.\",\"first_name\":\"Daniel\",\"middle_name\":\"Sanchez\",\"last_name\":\"Rivera\",\"created_at\":\"2022-11-20T16:36:25.000000Z\",\"updated_at\":\"2022-11-20T16:36:25.000000Z\"}}',NULL,'2022-11-20 16:36:25','2022-11-20 16:36:25'),(35,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',6,'App\\Models\\User',1,'{\"attributes\":{\"id\":6,\"case_no\":6,\"complainant_id\":11,\"respondent_id\":12,\"created_at\":\"2022-11-20T16:36:25.000000Z\",\"updated_at\":\"2022-11-20T16:36:25.000000Z\"}}',NULL,'2022-11-20 16:36:25','2022-11-20 16:36:25'),(36,'Account','Person signature created','App\\Models\\Person_Signatur