 benefits except for accrued leave credits, and perpetual disqualification from holding public office.\",\"date_of_incident\":\"2021-12-08 00:00:00\",\"date_reported\":\"2022-11-21 00:38:35\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:38:35.000000Z\",\"updated_at\":\"2022-11-20T16:38:35.000000Z\"}}',NULL,'2022-11-20 16:38:35','2022-11-20 16:38:35'),(44,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',8,'App\\Models\\User',1,'{\"attributes\":{\"id\":8,\"article_no\":269,\"case_no\":8,\"created_at\":\"2022-11-20T16:38:35.000000Z\",\"updated_at\":\"2022-11-20T16:38:35.000000Z\"}}',NULL,'2022-11-20 16:38:35','2022-11-20 16:38:35'),(45,'Account','Person created','App\\Models\\Person','created',15,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":15,\"salutation\":\"Mr.\",\"first_name\":\"Roel\",\"middle_name\":\"Arroyo\",\"last_name\":\"Valdez\",\"created_at\":\"2022-11-20T16:38:35.000000Z\",\"updated_at\":\"2022-11-20T16:38:35.000000Z\"}}',NULL,'2022-11-20 16:38:35','2022-11-20 16:38:35'),(46,'Account','Person created','App\\Models\\Person','created',16,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":16,\"salutation\":\"Mr.\",\"first_name\":\"Felix\",\"middle_name\":\"Gonzales\",\"last_name\":\"Bautista\",\"created_at\":\"2022-11-20T16:38:35.000000Z\",\"updated_at\":\"2022-11-20T16:38:35.000000Z\"}}',NULL,'2022-11-20 16:38:35','2022-11-20 16:38:35'),(47,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',8,'App\\Models\\User',1,'{\"attributes\":{\"id\":8,\"case_no\":8,\"complainant_id\":15,\"respondent_id\":16,\"created_at\":\"2022-11-20T16:38:35.000000Z\",\"updated_at\":\"2022-11-20T16:38:35.000000Z\"}}',NULL,'2022-11-20 16:38:35','2022-11-20 16:38:35'),(48,'Account','Person signature created','App\\Models\\Person_Signature','created',8,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":8,\"file_address\":\"1668962315.png\",\"person_id\":15,\"created_at\":\"2022-11-20T16:38:35.000000Z\",\"updated_at\":\"2022-11-20T16:38:35.000000Z\"}}',NULL,'2022-11-20 16:38:35','2022-11-20 16:38:35'),(49,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',9,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":9,\"case_title\":\"Ortiz vs Tamayo\",\"complaint_desc\":\"That was about 4 in the afternoon of 17th September 2012 at barangay Centro Norte, Sto. Nino, Manila and within the jurisdiction of this Honorable Court, the above named accused, with ill motive, did then and there willfully, unlawfully, and feloniously, uttered defamatory remarks against the honor and reputation of the undersigned complaint Mrs. Zoey Arellano Ortiz, the following words and or phrases address to the undersigned complainant UKININAM, PUTA, AWAN ADADAL MO which if translated in the English language would mean, VULVA OF YOUR MOTHER, PROSTITUTE, ILLITERATE.\",\"relief_desc\":\"The MCTC must found Tamayo guilty beyond reasonable doubt of the crime of Grave Oral Defamation, and accordingly, sentenced her to suffer the penalty of imprisonment of one year and one day, as minimum, to one year and eight months, as maximum, of prision correctional and ordered to pay Ortiz the amount of P20,000.00 as moral damages, as well as the costs of suit.\",\"date_of_incident\":\"2022-09-11 00:00:00\",\"date_reported\":\"2022-11-21 00:39:45\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:39:45.000000Z\",\"updated_at\":\"2022-11-20T16:39:45.000000Z\"}}',NULL,'2022-11-20 16:39:45','2022-11-20 16:39:45'),(50,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',9,'App\\Models\\User',1,'{\"attributes\":{\"id\":9,\"article_no\":364,\"case_no\":9,\"created_at\":\"2022-11-20T16:39:45.000000Z\",\"updated_at\":\"2022-11-20T16:39:45.000000Z\"}}',NULL,'2022-11-20 16:39:45','2022-11-20 16:39:45'),(51,'Account','Person created','App\\Models\\Person','created',17,'Ap