.\",\"relief_desc\":\"Mr. John Zamora Acosta must be convicted by the Municipal Court of Manila City of the crime of simple seduction, upon complaint of Ms. Jamie Pineda, and must be sentenced to imprisonment for two months and one day.\",\"date_of_incident\":\"2022-04-15 00:00:00\",\"date_reported\":\"2022-11-21 00:41:22\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:41:22.000000Z\",\"updated_at\":\"2022-11-20T16:41:22.000000Z\"}}',NULL,'2022-11-20 16:41:22','2022-11-20 16:41:22'),(56,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',10,'App\\Models\\User',1,'{\"attributes\":{\"id\":10,\"article_no\":338,\"case_no\":10,\"created_at\":\"2022-11-20T16:41:22.000000Z\",\"updated_at\":\"2022-11-20T16:41:22.000000Z\"}}',NULL,'2022-11-20 16:41:22','2022-11-20 16:41:22'),(57,'Account','Person created','App\\Models\\Person','created',19,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":19,\"salutation\":\"Mrs.\",\"first_name\":\"Jamie\",\"middle_name\":\"Abad\",\"last_name\":\"Pineda\",\"created_at\":\"2022-11-20T16:41:22.000000Z\",\"updated_at\":\"2022-11-20T16:41:22.000000Z\"}}',NULL,'2022-11-20 16:41:22','2022-11-20 16:41:22'),(58,'Account','Person created','App\\Models\\Person','created',20,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":20,\"salutation\":\"Mr.\",\"first_name\":\"John\",\"middle_name\":\"Zamora\",\"last_name\":\"Acosta\",\"created_at\":\"2022-11-20T16:41:22.000000Z\",\"updated_at\":\"2022-11-20T16:41:22.000000Z\"}}',NULL,'2022-11-20 16:41:22','2022-11-20 16:41:22'),(59,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',10,'App\\Models\\User',1,'{\"attributes\":{\"id\":10,\"case_no\":10,\"complainant_id\":19,\"respondent_id\":20,\"created_at\":\"2022-11-20T16:41:22.000000Z\",\"updated_at\":\"2022-11-20T16:41:22.000000Z\"}}',NULL,'2022-11-20 16:41:22','2022-11-20 16:41:22'),(60,'Account','Person signature created','App\\Models\\Person_Signature','created',10,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":10,\"file_address\":\"1668962482.png\",\"person_id\":19,\"created_at\":\"2022-11-20T16:41:22.000000Z\",\"updated_at\":\"2022-11-20T16:41:22.000000Z\"}}',NULL,'2022-11-20 16:41:22','2022-11-20 16:41:22'),(61,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',11,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":11,\"case_title\":\"Union vs Tamondong\",\"complaint_desc\":\"Union bank filed two complaints for sum of money with prayer for a writ of replevin against spouses Eddie and Eliza Tamondong and a John Doe. The first complaint was filed before the RTC, Branch 109, Pasay City on April 13, 1998. The second complaint was filed on March 15, 2000 and was raffled in the MeTC, Branch 47, Pasay City. In both cases, Desi Tomas executed and signed the Certification against Forum Shopping.\",\"relief_desc\":\"The petitioners prayed that the ruling of the MeTC Makati City be annulled and set aside on the ground of grave abuse of discretion. They also cited the rulings in US vs. Canet and Ilusorio v. Bildner which state that venue and jurisdiction should be in the place where the false document was presented\",\"date_of_incident\":\"2022-11-04 00:00:00\",\"date_reported\":\"2022-11-21 00:42:44\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:42:44.000000Z\",\"updated_at\":\"2022-11-20T16:42:44.000000Z\"}}',NULL,'2022-11-20 16:42:44','2022-11-20 16:42:44'),(62,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',11,'App\\Models\\User',1,'{\"attributes\":{\"id\":11,\"article_no\":175,\"case_no\":11,\"created_at\":\"2022-11-20T16:42:44.000000Z\",\"updated_at\":\"2022-11-20T16:42:44.000000Z\"}}',NULL,'2022-11-20 16:42:44','2022-11-20 16:42:44'),(63,'Account','Person created','App\\Models\\Person','created',21,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":21,\"salutation\":\"Mr.\",\"first_name\":\"Bank\",\"middle_name\":\"PH\",\"last_name\":\"Union\",\"created_at\":\"2022-11-20T16:42:44.000000Z\",\"updated_at\":\"2022-11-20T16:42:44.000000Z\"}}',NULL,'2022-11-20 16:42:44','2022-11-20 16:42:44'),(64,'Account','Person created','App\\Models\\Person','created',22,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":22,\"salutation\":\"Mrs.\",\"first_name\":\"Eliza\",\"middle_name\":\"Reyes\",\"last_name\":\"Tamondong\",\"created_at\":\"2022-11-20T16:42:44.000000Z\",\"updated_at\":\"2022-11-20T16:42:44.000000Z\"}}',NULL,'2022-11-20 16:42:44','2022-11-20 16:42:44'),(65,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',11,'App\\Models\\User',1,'{\"attributes\":{\"id\":11,\"case_no\":11,\"complainant_id\":21,\"respondent_id\":22,\"created_at\":\"2022-11-20T16:42:44.000000Z\",\"updated_at\":\"2022-11-20T16:42:44.000000Z\"}}',NULL,'2022-11-20 16:42:44','2022-11-20 16:42:44'),(66,'Account','Person signature created','App\\Models\\Person_Signature','created',11,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":11,\"file_address\":\"1668962564.png\",\"person_id\":21,\"created_at\":\"2022-11-20T16:42:44.000000Z\",\"updated_at\":\"2022-11-20T16:42:44.000000Z\"}}',NULL,'2022-11-20 16:42:44','2022-11-20 16:42:44'),(67,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',12,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":12,\"case_title\":\"Binon vs Sario\",\"complaint_desc\":\"On June 23, 2021, a file of complaint was placed due to illegal use of a Police Uniform by Alfed Mora Sario. According to complainant Charles Udon Binon, the respondent was forcing him to pay an amount of Php 2,500.00 due to not wearing a face mask in public. Binon added that Sario even made a scene at the public market. He was drinking water when he removed his face mask, then a Police Officer named Sario came to him and asked to pay a fine. Binon insisted on his reason and asked the Police Officer to go to the police station but Sario declined. He was asking for an Identification but Sario cannot give one. One of the strangers came and said that he is not a police officer.\",\"relief_desc\":\"Charles U. Binon is hereby asking to take immediate action to what Sario did. This is a crime, and he should be placed behind bars, Binon added. This case will be further inspected first by the barangay then if it is out of the Barangays jurisdiction, it will be passed to the Police.\",\"date_of_incident\":\"2021-06-23 00:00:00\",\"date_reported\":\"2022-11-21 00:43:37\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:43:37.000000Z\",\"updated_at\":\"2022-11-20T16:43:37.000000Z\"}}',NULL,'2022-11-20 16:43:37','2022-11-20 16:43:37'),(68,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',12,'App\\Models\\User',1,'{\"attributes\":{\"id\":12,\"article_no\":179,\"case_no\":12,\"created_at\":\"2022-11-20T16:43:37.000000Z\",\"updated_at\":\"2022-11-20T16:43:37.000000Z\"}}',NULL,'2022-11-20 16:43:37','2022-11-20 16:43:37'),(69,'Account','Person created','App\\Models\\Person','created',23,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":23,\"salutation\":\"Mr.\",\"first_name\":\"Charles\",\"middle_name\":\"Udon\",\"last_name\":\"Binon\",\"created_at\":\"2022-11-20T16:43:37.000000Z\",\"updated_at\":\"2022-11-20T16:43:37.000000Z\"}}',NULL,'2022-11-20 16:43:37','2022-11-20 16:43:37'),(70,'Account','Person created','App\\Models\\Person','created',24,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":24,\"salutation\":\"Mr.\",\"first_name\":\"Alfred\",\"middle_name\":\"Mora\",\"last_name\":\"Sario\",\"created_at\":\"2022-11-20T16:43:37.000000Z\",\"updated_at\":\"2022-11-20T16:43:37.000000Z\"}}',NULL,'2022-11-20 16:43:37','2022-11-20 16:43:37'),(71,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',12,'App\\Models\\User',1,'{\"attributes\":{\"id\":12,\"case_no\":12,\"complainant_id\":23,\"respondent_id\":24,\"created_at\":\"2022-11-20T16:43:37.000000Z\",\"updated_at\":\"2022-11-20T16:43:37.000000Z\"}}',NULL,'2022-11-20 16:43:37','2022-11-20 16:43:37'),(72,'Account','Person signature created','App\\Models\\Person_Signature','created',12,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":12,\"file_address\":\"1668962617.png\",\"person_id\":23,\"created_at\":\"2022-11-20T16:43:37.000000Z\",\"updated_at\":\"2022-11-20T16:43:37.000000Z\"}}',NULL,'2022-11-20 16:43:37','2022-11-20 16:43:37'),(73,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',13,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":13,\"case_title\":\"Conrad vs Lopez\",\"complaint_desc\":\"On the 27th day of April 2022, Shane Diez Conrad filed a complaint against Venjo Sicat Lopez at the Barangay. According to Conrad, Lopez surprisingly came to her when she was just standing at the park. She was waiting for her friend to come but then Lopez started to arouse her by forcing her to give her phone number and name. When Conrad declined. Lopez grabbed Conrads arms and forcefully asked for the number. Some of the tricycle drivers came to Conrad for rescue. \\r\\n\\r\\nAccording to the tricycle drivers, they did not notice the incident immediately. They thought Lopez was her boyfriend. When they saw the grabbing or arms made by Lopez, they went to her.\",\"relief_desc\":\"According to the complainant, Shane Diez Conrad is asking for a serious offense for the respondent. Conrad then asked for a payment to have a medical check up for her arms. Moreover, she also asked for payment for emotional stress the incident caused her. There will be a discussion for this relief asked.\",\"date_of_incident\":\"2022-04-27 00:00:00\",\"date_reported\":\"2022-11-21 00:44:40\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:44:40.000000Z\",\"updated_at\":\"2022-11-20T16:44:40.000000Z\"}}',NULL,'2022-11-20 16:44:40','2022-11-20 16:44:40'),(74,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',13,'App\\Models\\User',1,'{\"attributes\":{\"id\":13,\"article_no\":338,\"case_no\":13,\"created_at\":\"2022-11-20T16:44:40.000000Z\",\"updated_at\":\"2022-11-20T16:44:40.000000Z\"}}',NULL,'2022-11-20 16:44:40','2022-11-20 16:44:40'),(75,'Account','Person created','App\\Models\\Person','created',25,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":25,\"salutation\":\"Mrs.\",\"first_name\":\"Shane\",\"middle_name\":\"Diez\",\"last_name\":\"Conrad\",\"created_at\":\"2022-11-20T16:44:40.000000Z\",\"updated_at\":\"2022-11-20T16:44:40.000000Z\"}}',NULL,'2022-11-20 16:44:40','2022-11-20 16:44:40'),(76,'Account','Person created','App\\Models\\Person','created',26,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":26,\"salutation\":\"Mr.\",\"first_name\":\"Venjo\",\"middle_name\":\"Sicat\",\"last_name\":\"Lopez\",\"created_at\":\"2022-11-20T16:44:40.000000Z\",\"updated_at\":\"2022-11-20T16:44:40.000000Z\"}}',NULL,'2022-11-20 16:44:40','2022-11-20 16:44:40'),(77,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',13,'App\\Models\\User',1,'{\"attributes\":{\"id\":13,\"case_no\":13,\"complainant_id\":25,\"respondent_id\":26,\"created_at\":\"2022-11-20T16:44:40.000000Z\",\"updated_at\":\"2022-11-20T16:44:40.000000Z\"}}',NULL,'2022-11-20 16:44:40','2022-11-20 16:44:40'),(78,'Account','Person signature created','App\\Models\\Person_Signature','created',13,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":13,\"file_address\":\"1668962680.png\",\"person_id\":25,\"created_at\":\"2022-11-20T16:44:40.000000Z\",\"updated_at\":\"2022-11-20T16:44:40.000000Z\"}}',NULL,'2022-11-20 16:44:40','2022-11-20 16:44:40'),(79,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',14,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":14,\"case_title\":\"Quijano vs Barang\",\"complaint_desc\":\"Despite the QR code security feature of the new quarantine passes to prevent counterfeiting, at least 46 fake passes were confiscated by police authorities at a checkpoint in Barangay Capitol Site, Cebu City yesterday.\\r\\n\\r\\nPolice Major Elisandro Quijano, commander of Abellana Police Station, said the number may increase as soon as the consolidated reports from all quarantine control points are in. No arrests were made for humanitarian reasons, but the bearers were warned that they will be charged if they are caught again in possession of a fake quarantine pass.\\r\\n\\r\\nGenuine quarantine passes are identified not by scanning the QR code sticker but by manual visual examination.\\r\\n\\r\\nQuijano said that fake ones are determined by comparing them to the printed and laminated original quarantine pass provided to them by the Cebu City government. Cebu City mayor Edgardo Labella explained that the printing of the new passes was based on the data provided by the Department of Health.\",\"relief_desc\":\"We will release them and request that they return to their homes for the sake of humanity, but we will still prosecute them for violating Articles 175.\",\"date_of_incident\":\"2021-06-17 00:00:00\",\"date_reported\":\"2022-11-21 00:45:45\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:45:45.000000Z\",\"updated_at\":\"2022-11-20T16:45:45.000000Z\"}}',NULL,'2022-11-20 16:45:45','2022-11-20 16:45:45'),(80,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',14,'App\\Models\\User',1,'{\"attributes\":{\"id\":14,\"article_no\":175,\"case_no\":14,\"created_at\":\"2022-11-20T16:45:45.000000Z\",\"updated_at\":\"2022-11-20T16:45:45.000000Z\"}}',NULL,'2022-11-20 16:45:45','2022-11-20 16:45:45'),(81,'Account','Person created','App\\Models\\Person','created',27,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":27,\"salutation\":\"Mr.\",\"first_name\":\"Elisandro\",\"middle_name\":\"Santos\",\"last_name\":\"Quijano\",\"created_at\":\"2022-11-20T16:45:45.