or 19 days until the prosecutor dismissed the case the police had filed for illegal possession of shabu, the suspect was ordered released Saturday, August 5.\",\"relief_desc\":\"Meanwhile, Dr. Canete has requested on Sunday the Philippine National Police Regional Office 18 or the Negros Island Region for the immediate relief of these policemen.\",\"date_of_incident\":\"2022-08-05 00:00:00\",\"date_reported\":\"2022-11-21 00:47:03\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:47:03.000000Z\",\"updated_at\":\"2022-11-20T16:47:03.000000Z\"}}',NULL,'2022-11-20 16:47:03','2022-11-20 16:47:03'),(86,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',15,'App\\Models\\User',1,'{\"attributes\":{\"id\":15,\"article_no\":269,\"case_no\":15,\"created_at\":\"2022-11-20T16:47:03.000000Z\",\"updated_at\":\"2022-11-20T16:47:03.000000Z\"}}',NULL,'2022-11-20 16:47:03','2022-11-20 16:47:03'),(87,'Account','Person created','App\\Models\\Person','created',29,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":29,\"salutation\":\"Mrs.\",\"first_name\":\"Charlie\",\"middle_name\":\"Sta Ana\",\"last_name\":\"Marollano\",\"created_at\":\"2022-11-20T16:47:03.000000Z\",\"updated_at\":\"2022-11-20T16:47:03.000000Z\"}}',NULL,'2022-11-20 16:47:03','2022-11-20 16:47:03'),(88,'Account','Person created','App\\Models\\Person','created',30,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":30,\"salutation\":\"Mr.\",\"first_name\":\"Police\",\"middle_name\":\"Negros Occidental\",\"last_name\":\"Officers\",\"created_at\":\"2022-11-20T16:47:03.000000Z\",\"updated_at\":\"2022-11-20T16:47:03.000000Z\"}}',NULL,'2022-11-20 16:47:03','2022-11-20 16:47:03'),(89,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',15,'App\\Models\\User',1,'{\"attributes\":{\"id\":15,\"case_no\":15,\"complainant_id\":29,\"respondent_id\":30,\"created_at\":\"2022-11-20T16:47:03.000000Z\",\"updated_at\":\"2022-11-20T16:47:03.000000Z\"}}',NULL,'2022-11-20 16:47:03','2022-11-20 16:47:03'),(90,'Account','Person signature created','App\\Models\\Person_Signature','created',15,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":15,\"file_address\":\"1668962823.png\",\"person_id\":29,\"created_at\":\"2022-11-20T16:47:03.000000Z\",\"updated_at\":\"2022-11-20T16:47:03.000000Z\"}}',NULL,'2022-11-20 16:47:03','2022-11-20 16:47:03'),(91,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',16,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":16,\"case_title\":\"Manebali vs Mien\",\"complaint_desc\":\"Wilfredo Christian P. Mien is the registered owner of a blue Honda motorcycle, 2004 model. According to the prosecution, Christian used his motorcycle on December 10, 2010, at about 6 a.m., when he went to work at St. John Hospital in Panganiban Drive, Naga City. He parked his motorcycle in front of the hospital, in the parking area of the Nazareno Drug Store.\\r\\n\\r\\nAfter finishing his shift at about 2 p.m., Christian discovered that his motorcycle was no longer in its parking spot. Unable to find his motorcycle, Christian went to the Philippine National Police Naga City Police Office, Police Precinct No. 2 to report that his motorcycle was stolen. The police recorded the incident in the Daily Record of Events.\",\"relief_desc\":\"The trial court failed to obtain jurisdiction over the people of Marvin co accused, including Albert, the person in whose possession the motorcycle was found. Nonetheless, in its judgment 34 promulgated on December 5, 2014, the trial court found Marvin guilty beyond reasonable doubt of the crime of carnapping, punishable under R.A. No. 6539.\",\"date_of_incident\":\"2019-03-20 00:00:00\",\"date_reported\":\"2022-11-21 00:48:23\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:48:23.000000Z\",\"updated_at\":\"2022-11-20T16:48:23.000000Z\"}}',NULL,'2022-11-20 16:48:23','2022-11-20 16:48:23'),(92,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',16,'App\\Models\\User',1,'{\"attributes\":{\"id\":16,\"article_no\":269,\"case_no\":16,\"created_at\":\"2022-11-20T16:48:23.000000Z\",\"updated_at\":\"2022-11-20T16:48:23.000000Z\"}}',NULL,'2022-11-20 16:48:23','2022-11-20 16:48:23'),(93,'Account','Person created','App\\Models\\Person','created',31,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":31,\"salutation\":\"Mr.\",\"first_name\":\"Marvin\",\"middle_name\":\"Porteria Y\",\"last_name\":\"Manebali\",\"created_at\":\"2022-11-20T16:48:23.000000Z\",\"updated_at\":\"2022-11-20T16:48:23.000000Z\"}}',NULL,'2022-11-20 16:48:23','2022-11-20 16:48:23'),(94,'Account','Person created','App\\Models\\Person','created',32,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":32,\"salutation\":\"Mr.\",\"first_name\":\"Wilfredo Christian\",\"middle_name\":\"Pasang\",\"last_name\":\"Mien\",\"created_at\":\"2022-11-20T16:48:23.000000Z\",\"updated_at\":\"2022-11-20T16:48:23.000000Z\"}}',NULL,'2022-11-20 16:48:23','2022-11-20 16:48:23'),(95,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',16,'App\\Models\\User',1,'{\"attributes\":{\"id\":16,\"case_no\":16,\"complainant_id\":31,\"respondent_id\":32,\"created_at\":\"2022-11-20T16:48:23.000000Z\",\"updated_at\":\"2022-11-20T16:48:23.000000Z\"}}',NULL,'2022-11-20 16:48:23','2022-11-20 16:48:23'),(96,'Account','Person signature created','App\\Models\\Person_Signature','created',16,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":16,\"file_address\":\"1668962903.png\",\"person_id\":31,\"created_at\":\"2022-11-20T16:48:23.000000Z\",\"updated_at\":\"2022-11-20T16:48:23.000000Z\"}}',NULL,'2022-11-20 16:48:23','2022-11-20 16:48:23'),(97,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',17,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":17,\"case_title\":\"Dumaua vs Ramos\",\"complaint_desc\":\"This case stemmed from an Information filed before the Municipal Circuit Trial Court of Sto. Nino, Cagayan Province charging Ramos of the crime of Grave Oral Defamation.\",\"relief_desc\":\"In a Decision dated September 4, 2014, the RTC affirmed the MCTC ruling in toto It found that the prosecution has indeed established the fact that Ramos uttered defamatory statements of a serious and insulting nature against Dumaua through the positive testimonies not only of the latter.\\r\\n\\r\\nDissatisfied, Ramos filed a petition for review under Rule 42 of the Rules of Court before the CA\",\"date_of_incident\":\"2016-03-19 00:00:00\",\"date_reported\":\"2022-11-21 00:49:30\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:49:30.000000Z\",\"updated_at\":\"2022-11-20T16:49:30.000000Z\"}}',NULL,'2022-11-20 16:49:30','2022-11-20 16:49:30'),(98,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',17,'App\\Models\\User',1,'{\"attributes\":{\"id\":17,\"article_no\":364,\"case_no\":17,\"created_at\":\"2022-11-20T16:49:30.000000Z\",\"updated_at\":\"2022-11-20T16:49:30.000000Z\"}}',NULL,'2022-11-20 16:49:30','2022-11-20 16:49:30'),(99,'Account','Person created','App\\Models\\Person','created',33,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":33,\"salutation\":\"Mrs.\",\"first_name\":\"Patrocinia\",\"middle_name\":\"Mosa\",\"last_name\":\"Dumaua\",\"created_at\":\"2022-11-20T16:49:30.000000Z\",\"updated_at\":\"2022-11-20T16:49:30.000000Z\"}}',NULL,'2022-11-20 16:49:30','2022-11-20 16:49:30'),(100,'Account','Person created','App\\Models\\Person','created',34,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":34,\"salutation\":\"Mrs.\",\"first_name\":\"Digna\",\"middle_name\":\"Reyes\",\"last_name\":\"Ramos\",\"created_at\":\"2022-11-20T16:49:30.000000Z\",\"updated_at\":\"2022-11-20T16:49:30.000000Z\"}}',NULL,'2022-11-20 16:49:30','2022-11-20 16:49:30'),(101,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',17,'App\\Models\\User',1,'{\"attributes\":{\"id\":17,\"case_no\":17,\"complainant_id\":33,\"respondent_id\":34,\"created_at\":\"2022-11-20T16:49:30.000000Z\",\"updated_at\":\"2022-11-20T16:49:30.000000Z\"}}',NULL,'2022-11-20 16:49:30','2022-11-20 16:49:30'),(102,'Account','Person signature created','App\\Models\\Person_Signature','created',17,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":17,\"file_address\":\"1668962970.png\",\"person_id\":33,\"created_at\":\"2022-11-20T16:49:30.000000Z\",\"updated_at\":\"2022-11-20T16:49:30.000000Z\"}}',NULL,'2022-11-20 16:49:30','2022-11-20 16:49:30'),(103,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',18,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":18,\"case_title\":\"Darong vs Paera\",\"complaint_desc\":\"As punong barangay of Mampas, Bacong, Negros Oriental, petitioner Santiago Paera allocated his constituents use of communal water coming from a communal tank by limiting distribution to the residents of Mampas, Bacong. The tank sits on a land located in the neighboring barangay of Mampas, Valencia and owned by complainant Vicente Darong father of complainant Indalecio Darong. Despite petitioner scheme, Indalecio continued drawing water from the tank. On 7 April 1999, a petitioner reminded Indalecio of the water distribution scheme and cut Indalecio access.\\r\\n\\r\\nThe following day, petitioner inspected the tank after constituents complained of water supply interruption. Petitioner discovered a tap from the main line which he promptly disconnected. To stem the flow of water from the ensuing leak, a petitioner, using a borrowed bolo, fashioned a wooden plug. It was at this point when Indalecio arrived. What happened next is contested by the parties.\",\"relief_desc\":\"To limit his liability to one count of Grave Threats, petitioner tries to fit the facts of the case to the concept of which envisages a single crime committed through a series of acts arising from one criminal intent or resolution. To fix the penalty for his supposed single continued crime, petitioner invokes the rule for complex crime under Article 48 of the RPC imposing the penalty for the most serious crime, applied in its maximum period.\",\"date_of_incident\":\"2021-05-30 00:00:00\",\"date_reported\":\"2022-11-21 00:50:46\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:50:46.000000Z\",\"updated_at\":\"2022-11-20T16:50:46.000000Z\"}}',NULL,'2022-11-20 16:50:46','2022-11-20 16:50:46'),(104,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',18,'App\\Models\\User',1,'{\"attributes\":{\"id\":18,\"article_no\":286,\"case_no\":18,\"created_at\":\"2022-11-20T16:50:46.000000Z\",\"updated_at\":\"2022-11-20T16:50:46.000000Z\"}}',NULL,'2022-11-20 16:50:46','2022-11-20 16:50:46'),(105,'Account','Person created','App\\Models\\Person','created',35,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":35,\"salutation\":\"Mr.\",\"first_name\":\"Vicente\",\"middle_name\":\"Coim\",\"last_name\":\"Darong\",\"created_at\":\"2022-11-20T16:50:46.000000Z\",\"updated_at\":\"2022-11-20T16:50:46.000000Z\"}}',NULL,'2022-11-20 16:50:46','2022-11-20 16:50:46'),(106,'Account','Person created','App\\Models\\Person','created',36,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":36,\"salutation\":\"Mr.\",\"first_name\":\"Santiago\",\"middle_name\":\"Perez\",\"last_name\":\"Paera\",\"created_at\":\"2022-11-20T16:50:46.000000Z\",\"updated_at\":\"2022-11-20T16:50:46.000000Z\"}}',NULL,'2022-11-20 16:50:46','2022-11-20 16:50:46'),(107,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',18,'App\\Models\\User',1,'{\"attributes\":{\"id\":18,\"case_no\":18,\"complainant_id\":35,\"respondent_id\":36,\"created_at\":\"2022-11-20T16:50:46.000000Z\",\"updated_at\":\"2022-11-20T16:50:46.000000Z\"}}',NULL,'2022-11-20 16:50:46','2022-11-20 16:50:46'),(108,'Account','Person signature created','App\\Models\\Person_Signature','created',18,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":18,\"file_address\":\"1668963046.png\",\"person_id\":35,\"created_at\":\"2022-11-20T16:50:46.000000Z\",\"updated_at\":\"2022-11-20T16:50:46.000000Z\"}}',NULL,'2022-11-20 16:50:46','2022-11-20 16:50:46'),(109,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',19,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":19,\"case_title\":\"Sucat vs Calaoagan\",\"complaint_desc\":\"That on or about the 31st day of October, 2004, at around 12 midnight, in Brgy. Poblacion, Municipality of Rosales, Province of Pangasinan, and within the jurisdiction of this Honorable Court, the above named accused, did then and there, willfully unlawfully and feloniously and for no apparent reason, physically maltreat the complainant BBB, a minor of about 17 years of age by punching his face and head, thus place him in an embarrassing and shameful situation in the eyes of the public.\",\"relief_desc\":\"In its November 5, 2012, Decision, the RTC found petitioner guilty beyond reasonable doubt of two counts of Other Acts of Child Abuse, as defined and penalized under Sec. 10, par.\",\"date_of_incident\":\"2022-04-23 00:00:00\",\"date_reported\":\"2022-11-21 00:51:48\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:51:48.000000Z\",\"updated_at\":\"2022-11-20T16:51:48.000000Z\"}}',NULL,'2022-11-20 16:51:48','2022-11-20 16:51:48'),(110,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',19,'App\\Models\\User',1,'{\"attributes\":{\"id\":19,\"article_no\":266,\"case_no\":19,\"created_at\":\"2022-11-20T16:51:48.000000Z\",\"updated_at\":\"2022-11-20T16:51:48.000000Z\"}}',NULL,'2022-11-20 16:51:48','2022-11-20 16:51:48'),(111,'Account','Person created','App\\Models\\Person','created',37,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":37,\"salutation\":\"Mr.\",\"first_name\":\"Dain\",\"middle_name\":\"Lopan\",\"last_name\":\"Sucat\",\"created_at\":\"2022-11-20T16:51:48.000000Z\",\"updated_at\":\"2022-11-20T16:51:48.000000Z\"}}',NULL,'2022-11-20 16:51:48','2022-11-20 16:51:48'),(112,'Account','Person created','App\\Models\\Person','created',38,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":38,\"salutation\":\"Mr.\",\"first_name\":\"Jeffrey\",\"middle_name\":\"Sanya\",\"last_name\":\"Calaoagan\",\"created_at\":\"2022-11-20T16:51:48.000000Z\",\"updated_at\":\"2022-11-20T16:51:48.000000Z\"}}',NULL,'2022-11-20 16:51:48','2022-11-20 16:51:48'),(113,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',19,'App\\Models\\User',1,'{\"attributes\":{\"id\":19,\"case_no\":19,\"complainant_id\":37,\"respondent_id\":38,\"created_at\":\"2022-11-20T16:51:48.000000Z\",\"updated_at\":\"2022-11-20T16:51:48.000000Z\"}}',NULL,'2022-11-20 16:51:48','2022-11-20 16:51:48'),(114,'Account','Person signature created','App\\Models\\Person_Signature','created',19,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":19,\"file_address\":\"1668963108.png\",\"person_id\":37,\"created_at\":\"2022-11-20T16:51:48.000000Z\",\"updated_at\":\"2022-11-20T16:51:48.000000Z\"}}',NULL,'2022-11-20 16:51:48','2022-11-20 16:51:48'),(115,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',20,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":20,\"case_title\":\"Esteves vs Sapi\",\"complaint_desc\":\"According to the prosecution, at about 7 a.m. of January 15, 2018, a concerned citizen called a certain PO3 Esteves, police radio operator of the Nagcarlan Police Station, informing him that a certain alias Baho, who was later identified as Veridiano, was on the way to San Pablo City to obtain illegal drugs.\\r\\n\\r\\nAt the police station, PO1 Cabello turned over the seized tea bag to PO1 Solano, who also placed his initials. PO1 Solano then made a laboratory examination request, which he personally brought with the seized tea bag to the Philippine National Police Crime Laboratory. The contents of the tea bag tested positive for marijuana.\",\"relief_desc\":\"In the present case, the extensive search conducted by the police officers exceeded the allowable limits of warrantless searches. They had no probable cause to believe that the accused violated any law except for the tip they received. They did not observe any peculiar activity from the accused that may either arouse their suspicion or verify the tip. Moreover, the search was flawed at its inception. The checkpoint was set up to target the arrest of the accused.\",\"date_of_incident\":\"2019-01-05 00:00:00\",\"date_reported\":\"2022-11-21 00:52:55\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:52:55.000000Z\",\"updated_at\":\"2022-11-20T16:52:55.000000Z\"}}',NULL,'2022-11-20 16:52:55','2022-11-20 16:52:55'),(116,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',20,'App\\Models\\User',1,'{\"attributes\":{\"id\":20,\"article_no\":269,\"case_no\":20,\"created_at\":\"2022-11-20T16:52:55.000000Z\",\"updated_at\":\"2022-11-20T16:52:55.000000Z\"}}',NULL,'2022-11-20 16:52:55','2022-11-20 16:52:55'),(117,'Account','Person created','App\\Models\\Person','created',39,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":39,\"salutation\":\"Mr.\",\"first_name\":\"Brian\",\"middle_name\":\"Danay\",\"last_name\":\"Esteves\",\"created_at\":\"2022-11-20T16:52:55.000000Z\",\"updated_at\":\"2022-11-20T16:52:55.000000Z\"}}',NULL,'2022-11-20 16:52:55','2022-11-20 16:52:55'),(118,'Account','Person created','App\\Models\\Person','created',40,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":40,\"salutation\":\"Mr.\",\"first_name\":\"Mario\",\"middle_name\":\"Veridiano Y\",\"last_name\":\"Sapi\",\"created_at\":\"2022-11-20T16:52:55.000000Z\",\"updated_at\":\"2022-11-20T16:52:55.000000Z\"}}',NULL,'2022-11-20 16:52:55','2022-11-20 16:52:55'),(119,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',20,'App\\Models\\User',1,'{\"attributes\":{\"id\":20,\"case_no\":20,\"complainant_id\":39,\"respondent_id\":40,\"created_at\":\"2022-11-20T16:52:55.000000Z\",\"updated_at\":\"2022-11-20T16:52:55.000000Z\"}}',NULL,'2022-11-20 16:52:55','2022-11-20 16:52:55'),(120,'Account','Person signature created','App\\Models\\Person_Signature','created',20,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":20,\"file_address\":\"1668963175.png\",\"person_id\":39,\"created_at\":\"2022-11-20T16:52:55.000000Z\",\"updated_at\":\"2022-11-20T16:52:55.000000Z\"}}',NULL,'2022-11-20 16:52:55','2022-11-20 16:52:55'),(121,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',21,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":21,\"case_title\":\"Lopez vs Angkong\",\"complaint_desc\":\"Ms. Daisy Masukat Angkong asked the Brgy. Tanod Arnel Lopez on November 27, 2021 whether she could get her daughter Kate a barangay certificate so she could fulfill a school requirement. Kate does not have a legal ID, so Brgy. Tanod Arnel Lopez requested Kates birth certificate. When Brgy. Tanod Arnel Lopez viewed the birth certificate, she immediately recognized it was fake.\",\"relief_desc\":\"For the benefit of Kate, we continue to provide her with the Barangay Certificate she needs, but we will continue to pursue a case against her mother Ms. Daisy Masukat Angkong for breaking Article 175.\",\"date_of_incident\":\"2021-11-27 00:00:00\",\"date_reported\":\"2022-11-21 00:54:27\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:54:27.000000Z\",\"updated_at\":\"2022-11-20T16:54:27.000000Z\"}}',NULL,'2022-11-20 16:54:27','2022-11-20 16:54:27'),(122,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',21,'App\\Models\\User',1,'{\"attributes\":{\"id\":21,\"article_no\":175,\"case_no\":21,\"created_at\":\"2022-11-20T16:54:27.000000Z\",\"updated_at\":\"2022-11-20T16:54:27.000000Z\"}}',NULL,'2022-11-20 16:54:27','2022-11-20 16:54:27'),(123,'Account','Person created','App\\Models\\Person','created',41,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":41,\"salutation\":\"Mr.\",\"first_name\":\"Arnel\",\"middle_name\":\"Sinag\",\"last_name\":\"Lopez\",\"created_at\":\"2022-11-20T16:54:27.000000Z\",\"updated_at\":\"2022-11-20T16:54:27.000000Z\"}}',NULL,'2022-11-20 16:54:27','2022-11-20 16:54:27'),(124,'Account','Person created','App\\Models\\Person','created',42,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":42,\"salutation\":\"Ms.\",\"first_name\":\"Daisy\",\"middle_name\":\"Masukat\",\"last_name\":\"Angkong\",\"created_at\":\"2022-11-20T16:54:27.000000Z\",\"updated_at\":\"2022-11-20T16:54:27.000000Z\"}}',NULL,'2022-11-20 16:54:27','2022-11-20 16:54:27'),(125,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',21,'App\\Models\\User',1,'{\"attributes\":{\"id\":21,\"case_no\":21,\"complainant_id\":41,\"respondent_id\":42,\"created_at\":\"2022-11-20T16:54:27.000000Z\",\"updated_at\":\"2022-11-20T16:54:27.000000Z\"}}',NULL,'2022-11-20 16:54:27','2022-11-20 16:54:27'),(126,'Account','Person signature created','App\\Models\\Person_Signature','created',21,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":21,\"file_address\":\"1668963267.png\",\"person_id\":41,\"created_at\":\"2022-11-20T16:54:27.000000Z\",\"updated_at\":\"2022-11-20T16:54:27.000000Z\"}}',NULL,'2022-11-20 16:54:27','2022-11-20 16:54:27'),(127,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',22,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":22,\"case_title\":\"Ferrer vs Garcia\",\"complaint_desc\":\"On that morning of February 1, 2010, the defendant came to our residence and forcefully entered our house. On that said date and incident, the defendant had shouted at my wife Ms. Andrea and told her I will kill you while pointing his to my wife. On the afternoon of the date while we were walking in front of the Barangay Hall, the defendant had brought the knife and pointed it at us while shouting That is right, you are going to hit me for a while so that your chin will calm down. The defendant is a resident of this barangay, Barangay 385, and the complainants are likewise located in the same barangay\",\"relief_desc\":\"The respondent Mr. Ryan Cris Miguel Garcia be made to appear before the Lupong of Barangay 385. That after the notice and hearing, respondents are directed to avoid contact with the complainants.\",\"date_of_incident\":\"2020-02-01 00:00:00\",\"date_reported\":\"2022-11-21 00:55:39\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:55:39.000000Z\",\"updated_at\":\"2022-11-20T16:55:39.000000Z\"}}',NULL,'2022-11-20 16:55:39','2022-11-20 16:55:39'),(128,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',22,'App\\Models\\User',1,'{\"attributes\":{\"id\":22,\"article_no\":285,\"case_no\":22,\"created_at\":\"2022-11-20T16:55:39.000000Z\",\"updated_at\":\"2022-11-20T16:55:39.000000Z\"}}',NULL,'2022-11-20 16:55:39','2022-11-20 16:55:39'),(129,'Account','Person created','App\\Models\\Person','created',43,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":43,\"salutation\":\"Ms.\",\"first_name\":\"Andrea\",\"middle_name\":\"Javier\",\"last_name\":\"Ferrer\",\"created_at\":\"2022-11-20T16:55:39.000000Z\",\"updated_at\":\"2022-11-20T16:55:39.000000Z\"}}',NULL,'2022-11-20 16:55:39','2022-11-20 16:55:39'),(130,'Account','Person created','App\\Models\\Person','created',44,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":44,\"salutation\":\"Mr.\",\"first_name\":\"Ryan\",\"middle_name\":\"Miguel\",\"last_name\":\"Garcia\",\"created_at\":\"2022-11-20T16:55:39.000000Z\",\"updated_at\":\"2022-11-20T16:55:39.000000Z\"}}',NULL,'2022-11-20 16:55:39','2022-11-20 16:55:39'),(131,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',22,'App\\Models\\User',1,'{\"attributes\":{\"id\":22,\"case_no\":22,\"complainant_id\":43,\"respondent_id\":44,\"created_at\":\"2022-11-20T16:55:39.000000Z\",\"updated_at\":\"2022-11-20T16:55:39.000000Z\"}}',NULL,'2022-11-20 16:55:39','2022-11-20 16:55:39'),(132,'Account','Person signature created','App\\Models\\Person_Signature','created',22,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":22,\"file_address\":\"1668963339.png\",\"person_id\":43,\"created_at\":\"2022-11-20T16:55:39.000000Z\",\"updated_at\":\"2022-11-20T16:55:39.000000Z\"}}',NULL,'2022-11-20 16:55:39','2022-11-20 16:55:39'),(133,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',23,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":23,\"case_title\":\"Lopez vs Salvador\",\"complaint_desc\":\"On March 23, 2021, Dr. Anne Corpuz Salvador, a 41 year old at Brgy. 385, was detained today for her attempt to sell COVID 19 vaccination cards and homeoprophylaxis immunization pellets by pretending that clients had received the Food and Drug Administration approved Moderna vaccine. An anonymous report claims that Dr. Anne Corpuz Salvador is fabricating fraudulent vaccination records.\",\"relief_desc\":\"By exploiting anxieties and disseminating false information regarding FDA approved vaccinations, as well as by hawking phony cures that threaten people lives, Dr. Anne Corpuz Salvador deceived and harmed the public. Even worse, she made phony COVID19 vaccination cards and gave her clients the goahead to falsely mark that they had had a shot, allowing them to get around efforts to stop the diseases spread. During this time of national disaster, Barangay 385 is dedicated to defending the populace from fraudsters. The council opted not to involve the police because it is a deceitful activity.\",\"date_of_incident\":\"2021-03-23 00:00:00\",\"date_reported\":\"2022-11-21 00:56:41\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:56:41.000000Z\",\"updated_at\":\"2022-11-20T16:56:41.00000