bout 240 in the afternoon of this date, a cell phone call received by this station coming from the above named victim to report the above captioned case. Investigation disclosed that at around 730 in the morning of this date, the above named victim left her rented room to her newly boarded mate identified as Prince Khyler Langaig and went to her work at Dalton pawnshop. However, at around 1155 in the morning of the same date, one of the victims board mates identified as Rosalie Terana Pastolero informed her that her belongings inside her rented room were scattered on the floor. Then and there, the above named victim immediately returned home. Arriving at her boarding house, she discovered that some of her branded clothes were missing. Above named victim immediately located her board mate Prince Khyler Langaig but she could not be found anymore. She also checked the room of her board mate however all belongings of the latter were no longer inside his rented room and believed to be absconded with the above mentioned stolen items. Motive of the said incident is for personal gained\",\"relief_desc\":\"Case of theft is now being readied against the above named suspect through regular filing in court.\",\"date_of_incident\":\"2018-05-12 00:00:00\",\"date_reported\":\"2022-11-21 00:57:41\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:57:41.000000Z\",\"updated_at\":\"2022-11-20T16:57:41.000000Z\"}}',NULL,'2022-11-20 16:57:41','2022-11-20 16:57:41'),(140,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',24,'App\\Models\\User',1,'{\"attributes\":{\"id\":24,\"article_no\":309,\"case_no\":24,\"created_at\":\"2022-11-20T16:57:41.000000Z\",\"updated_at\":\"2022-11-20T16:57:41.000000Z\"}}',NULL,'2022-11-20 16:57:41','2022-11-20 16:57:41'),(141,'Account','Person created','App\\Models\\Person','created',47,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":47,\"salutation\":\"Ms.\",\"fir