Maibo, Tantangan South Cotabato, was found to be in possession of two stainless kitchen knives that were approximately twelve inches long without its handle and eighteen inches long with its handle each. According to the investigation, the aforementioned victim and the aforementioned suspect were out drinking with their respective friends and companions at the video ok store in Brgy. Zone I of this city when the aforementioned suspect, acting on his own initiative, deliberately stabbed the aforementioned victim, striking him in various locations on his body. Unsatisfied, the aforementioned suspect followed the aforementioned victim to the area of this station, where officers from this office were able to detain him. This incident was motivated by personal animosity.\",\"relief_desc\":\"A case of frustrated murderis now being readied against the apprehended suspect Mr. Alan Perez Canon for filing thru inquest proceedings at the City Prosecutor office, Hall of Justice, Koronadal City.\",\"date_of_incident\":\"2022-01-01 00:00:00\",\"date_reported\":\"2022-11-21 00:59:01\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T16:59:01.000000Z\",\"updated_at\":\"2022-11-20T16:59:01.000000Z\"}}',NULL,'2022-11-20 16:59:01','2022-11-20 16:59:01'),(146,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',25,'App\\Models\\User',1,'{\"attributes\":{\"id\":25,\"article_no\":265,\"case_no\":25,\"created_at\":\"2022-11-20T16:59:01.000000Z\",\"updated_at\":\"2022-11-20T16:59:01.000000Z\"}}',NULL,'2022-11-20 16:59:01','2022-11-20 16:59:01'),(147,'Account','Person created','App\\Models\\Person','created',49,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":49,\"salutation\":\"Mr.\",\"first_name\":\"Rodney\",\"middle_name\":\"Madayos\",\"last_name\":\"Puerto\",\"created_at\":\"2022-11-20T16:59:01.000000Z\",\"updated_at\":\"2022-11-20T16:59:01.000000Z\"}}',NULL,'2022-11-20 16:59:01','2022-11-20 16:59:0