ed in front of LBC Alunan Avenue, Brgy Zone IV, this City at around 155 PM of this date.\",\"date_of_incident\":\"2017-12-24 00:00:00\",\"date_reported\":\"2022-11-21 01:02:36\",\"processed_by\":1,\"compliance\":0,\"date_of_execution\":null,\"remarks\":\"\",\"created_at\":\"2022-11-20T17:02:36.000000Z\",\"updated_at\":\"2022-11-20T17:02:36.000000Z\"}}',NULL,'2022-11-20 17:02:36','2022-11-20 17:02:36'),(164,'Blotter Case','Incident case created','App\\Models\\Incident_Case','created',28,'App\\Models\\User',1,'{\"attributes\":{\"id\":28,\"article_no\":357,\"case_no\":28,\"created_at\":\"2022-11-20T17:02:36.000000Z\",\"updated_at\":\"2022-11-20T17:02:36.000000Z\"}}',NULL,'2022-11-20 17:02:36','2022-11-20 17:02:36'),(165,'Account','Person created','App\\Models\\Person','created',55,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":55,\"salutation\":\"Mr.\",\"first_name\":\"Bainot\",\"middle_name\":\"Macasayon\",\"last_name\":\"Guiapal\",\"created_at\":\"2022-11-20T17:02:36.000000Z\",\"updated_at\":\"2022-11-20T17:02:36.000000Z\"}}',NULL,'2022-11-20 17:02:36','2022-11-20 17:02:36'),(166,'Account','Person created','App\\Models\\Person','created',56,'App\\Models\\User',1,'{\"attributes\":{\"person_id\":56,\"salutation\":\"Mr.\",\"first_name\":\"Unidentified\",\"middle_name\":\"Unidentified\",\"last_name\":\"Unidentified\",\"created_at\":\"2022-11-20T17:02:36.000000Z\",\"updated_at\":\"2022-11-20T17:02:36.000000Z\"}}',NULL,'2022-11-20 17:02:36','2022-11-20 17:02:36'),(167,'Blotter Case','Case involved created','App\\Models\\Case_Involved','created',28,'App\\Models\\User',1,'{\"attributes\":{\"id\":28,\"case_no\":28,\"complainant_id\":55,\"respondent_id\":56,\"created_at\":\"2022-11-20T17:02:36.000000Z\",\"updated_at\":\"2022-11-20T17:02:36.000000Z\"}}',NULL,'2022-11-20 17:02:36','2022-11-20 17:02:36'),(168,'Account','Person signature created','App\\Models\\Person_Signature','created',28,'App\\Models\\User',1,'{\"attributes\":{\"file_id\":28,\"file_address\":\"1668963756.png\",\"person_id\":55,\"created_at\":\"2022-11-20T17:02:36.000000Z\",\"updated_at\":\"2022-11-20T17:02:36.000000Z\"}}',NULL,'2022-11-20 17:02:36','2022-11-20 17:02:36'),(169,'Blotter Case','Blotter case created','App\\Models\\Blotter','created',29,'App\\Models\\User',1,'{\"attributes\":{\"case_no\":29,\"case_title\":\"Navajo vs Jore\",\"complaint_desc\":\"A victim of a stabbing incident was taken to the South Cotabato Provincial Hospital on or around the morning of this day, according to Richie Cabaoan, a PSU member who is on duty there. Personnel from this station immediately headed to the previously mentioned hospital. A preliminary investigation identified the victim as Ryan Paldas Navajo, age 31, a married vulcanizer, and a resident of Prk Tuburan, Brgy Sta Cruz, Koronadal City. He had suffered a single stab wound to the left side of his neck and was being treated at the aforementioned hospital by Dr. Jerome Napoles, the attending physician at the hospital. Jogel Almania Jore, a 37yearold single carpenter from Navarro Street in Brgy. Gen. Paulino Santos, Koronadal City, and Rudy Zabala Villanueva, a 23 year old single laborer from the same neighborhood, were detained by staff members of this station during follow up. They were in the area of Koronadal City Police when the aforementioned suspects attempted to put in to record the incident under the pretense However, the witnesses who saw them may have recognized them as the culprits in the aforementioned stabbing incident, in which one Ryan Navajo was actually the true victim. The incident was motivated by personal animosity and intoxication.\",\"relief_desc\":\"Apprehended suspects were placed under custody of this station while a case of attempted homicide is being readied against them for filing thru inquest proceeding at City prosecutor office, Hall of Justice, Brgy Zone III, Koronadal City.\",\"date_of_incident\":\"2018-01-18 00:00:00\",\"date_reported\":\"2022-11-21 01:03:38\",\"processed_by\":1,\"complia