INSERT INTO `amicable_settlements` VALUES (1,'2022-11-28 18:51:23','Ms. Garcia will be released but given a sanction of public service after she completed her two weeks of quarantine.','2022-11-26 10:51:23','2022-11-26 10:51:23'),(2,'2022-11-28 18:58:33','Rojero agreed to render a public service to Brgy. 385 for violating Article No. 177 and 179.','2022-11-26 10:58:33','2022-11-26 10:58:33'),(3,'2022-12-03 11:07:10','By mutually signing this compromise and release agreement, Michael Mendoza and Rodjun Aquino guarantee that the respondent shall pay for the hospital bill for a total of 8500 pesos. And at the time of the Parties signing of this Agreement, respondent shall have sent by hand a cash in the amount of 8500 pesos to the complainant.','2022-12-03 03:07:10','2022-12-03 03:07:10'),(4,'2022-12-03 11:08:55','We, complainant and respondent in the above captioned case, do hereby agree to settle our dispute as follows:\r\n\r\n1. The respondent will not enter nor trespass on the property of the complainant, Lucas Morales Aguilar.\r\n2. If violated again, the complainant will not hesitate to make a file to court action.','2022-12-03 03:08:55','2022-12-03 03:08:55'),(5,'2022-12-07 09:40:44','Consequuntur animi','2022-12-07 01:40:44','2022-12-07 01:40:44');
